import { Link } from "react-router-dom";

function Header(props) {
  return (
    <nav>
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/celebirity">Celebirity</Link>
      </li>
      <li>
        <Link to="/movies">Moviessssssssssssssssssssss</Link>
      </li>
      <li>
        <Link to="/tv">TV</Link>
      </li>
    </nav>
  );
}
